import React from 'react'
import { Switch, Route } from 'react-router-dom';
import Signin from '../components/SignIn/Signin';
export default function MainRouter() {
    return (
        <div>
            <Switch>
                <Route exact path='/' component={Signin} />
            </Switch>
        </div>
    )
}
